CREATE DEFINER=`placebet365`@`localhost` PROCEDURE `GetChip` (IN `UserId` INT UNSIGNED)  BEGIN 

SELECT sum(Chips)as FreeChip FROM tblChips where IsFree = 1 and UserID = @p0;
SELECT sum(Chips)as Chip FROM tblChips where IsFree = 0  and UserID = @p0;

END$$

CREATE DEFINER=`placebet_Place36`@`%` PROCEDURE `getChipHistory` (IN `pType` INT, IN `pUserID` INT, IN `pMatchId` INT, IN `pMarketId` VARCHAR(100), `pForParent` INT)  BEGIN
DECLARE  LID INTEGER ;
DECLARE OID INTEGER ;
SET @runtot:=0; 
set @num:=0;
	set OID = pForParent;
	SET LID = (SELECT parentid FROM `createmaster` WHERE mstrid = pUserID); 
	if pForParent = LID then
	set	pForParent = 1;
	else
	set	pForParent = 0;
	end if;
IF pType = 3 THEN
	SELECT *,(@num:=@num+1) SrNo FROM (SELECT * FROM (SELECT '' RefNo, a.MstDate EDate,b.mstruserid UserC, CASE WHEN Chips > 0 THEN Chips ELSE 0 END Credit, CASE WHEN Chips < 0 THEN ABS(Chips) ELSE 0 END Debit, (@runtot := @runtot + Chips) Total, '' narration , Odds , Stack , CASE WHEN IFNULL(a.Result,0) = 1 THEN 'Win' ELSE 'Lost' END Status_, a.Mstcode FROM tblbets a INNER JOIN createmaster b ON a.UserId=b.mstrid
	WHERE ResultID IS NOT NULL AND MarketId = pMarketId AND MatchId = pMatchId AND UserId = pUserID 
	Union
	SELECT '' RefNo, a.dateTime EDate,b.mstruserid UserC, CASE WHEN Chips > 0 THEN Chips ELSE 0 END Credit, CASE WHEN Chips < 0 THEN ABS(Chips) ELSE 0 END Debit, (@runtot := @runtot + Chips) Total, CONCAT(c.matchname ,'>',a.FheadName ) narration ,OddsNumber Odds ,bet_value Stack , '' Status_, a.bet_id Mstcode FROM bet_entry a 
INNER JOIN createmaster b ON a.UserId=b.mstrid 
INNER JOIN matchmst c on a.MatchId = c.mstcode 
	WHERE ResultID is not null and a.MatchId = pMatchId and UserId = pUserID and a.fancyId = pMarketId ) p order by p.EDate, p.MstCode
	) k ORDER BY EDate DESC, MstCode DESC ;


ELSEIF pType = 2 THEN
	SELECT *,(@num:=@num+1) SrNo FROM (SELECT * FROM (SELECT '' RefNo, a.MstDate EDate,b.mstruserid UserC, ROUND((CASE WHEN Chips  > 0 THEN ABS(Chips) ELSE 0 END * case when pForParent = 1 then (a.Master+a.Admin) / 100 else 1 end ),2) Credit, ROUND ((CASE WHEN Chips < 0 THEN ABS(Chips) ELSE 0 END * case when pForParent = 1 then (a.Master+a.Admin) / 100 else 1 end),2) Debit, ROUND((@runtot := @runtot + Chips  * case when pForParent = 1 then (a.Master+a.Admin) / 100 else -1 end),2) Total, '' narration , Odds , Stack , CASE WHEN IFNULL(a.Result,0) = 1 THEN 'Win' ELSE 'Lost' END Status_, a.Mstcode FROM tblbets a INNER JOIN createmaster b ON a.UserId=b.mstrid
	WHERE ResultID IS NOT NULL AND MarketId = pMarketId AND MatchId = pMatchId AND ParantId = pUserID and a.UserId = case when pForParent = 1 then b.mstrid else OID end 
Union
	SELECT '' RefNo, a.dateTime EDate,b.mstruserid UserC, ROUND((CASE WHEN Chips > 0 THEN ABS(Chips) ELSE 0 END * case when pForParent = 1 then (a.Master+a.Admin) / 100 else 1 end ),2)Credit, ROUND((CASE WHEN Chips  < 0 THEN ABS(Chips) ELSE 0 END  * case when pForParent = 1 then (a.Master+a.Admin) / 100 else 1 end),2) Debit, ROUND((@runtot := @runtot + Chips * case when pForParent = 1 then (a.Master+a.Admin) / 100 else -1 end),2) Total, CONCAT(c.matchname ,'>',a.FheadName ) narration ,OddsNumber Odds ,bet_value Stack , '' Status_, a.bet_id Mstcode FROM bet_entry a 
INNER JOIN createmaster b ON a.UserId=b.mstrid 
INNER JOIN matchmst c on a.MatchId = c.mstcode 
	WHERE ResultID is not null and a.MatchId = pMatchId and ParantId = pUserID and a.fancyId = pMarketId  and a.UserId = case when pForParent = 1 then b.mstrid else OID end ) p order by p.EDate, p.MstCode ) k ORDER BY EDate DESC, MstCode DESC ;

ELSEIF pType = 1 THEN
	SELECT *,(@num:=@num+1) SrNo FROM (SELECT * FROM (SELECT '' RefNo, a.MstDate EDate,b.mstruserid UserC, ROUND((CASE WHEN Chips > 0 THEN Chips ELSE 0 END  * case when pForParent = 1 then (a.Admin) / 100 else (a.Master+a.Admin) / 100 end),2) Credit, ROUND((CASE WHEN Chips < 0 THEN ABS(Chips) ELSE 0 END * case when pForParent = 1 then (a.Admin) / 100 else (a.Master+a.Admin) / 100 end ),2) Debit, ROUND((@runtot := @runtot + Chips * case when pForParent = 1 then (a.Admin) / 100 else (a.Master+a.Admin) / 100 end) ,2) Total, '' narration , Odds , Stack , CASE WHEN IFNULL(a.Result,0) = 1 THEN 'Win' ELSE 'Lost' END Status_,a.Mstcode FROM tblbets a INNER JOIN createmaster b ON a.UserId=b.mstrid	
	WHERE ResultID IS NOT NULL AND MarketId = pMarketId AND MatchId = pMatchId AND ParantId IN (SELECT Mstrid  FROM createmaster WHERE usetype = 2 AND parentID = pUserID) and a.ParantId = case when pForParent = 1 then a.ParantId else OID end 
	Union
	SELECT '' RefNo, a.dateTime EDate,b.mstruserid UserC, ROUND((CASE WHEN Chips > 0 THEN Chips ELSE 0 END  * case when pForParent = 1 then (a.Admin) / 100 else (a.Master+a.Admin) / 100 end),2) Credit,ROUND(( CASE WHEN Chips < 0 THEN ABS(Chips) ELSE 0 END * case when pForParent = 1 then (a.Admin) / 100 else (a.Master+a.Admin) / 100 end ),2) Debit,ROUND( (@runtot := @runtot + Chips * case when pForParent = 1 then (a.Master+a.Admin) / 100 else (a.Master) / 100 end ),2) Total, CONCAT(c.matchname ,'>',a.FheadName ) narration ,OddsNumber Odds ,bet_value Stack , '' Status_, a.bet_id Mstcode FROM bet_entry a 
INNER JOIN createmaster b ON a.UserId=b.mstrid 
INNER JOIN matchmst c on a.MatchId = c.mstcode 
	WHERE ResultID is not null and a.MatchId = pMatchId and ParantId IN (SELECT Mstrid  FROM createmaster WHERE usetype = 2 AND parentID = pUserID) and a.fancyId = pMarketId and a.ParantId = case when pForParent = 1 then a.ParantId else OID end ) p order by p.EDate, p.MstCode ) k ORDER BY EDate DESC, MstCode DESC ; 
ELSEIF pType = 0 THEN
	SELECT '' RefNo, a.MstDate EDate,b.mstruserid UserC, ROUND((CASE WHEN Chips > 0 THEN Chips ELSE 0 END * (a.Master+a.Dealer) / 100),2) Credit,ROUND(( CASE WHEN Chips < 0 THEN ABS(Chips) ELSE 0 END * (a.Master+a.Dealer) / 100),2) Debit,ROUND( (@runtot := @runtot + Chips * (a.Master+a.Dealer) / 100),2) Total, '' narration , Odds , Stack , CASE WHEN IFNULL(a.Result,0) = 1 THEN 'Win' ELSE 'Lost' END Status_ ,(@num:=@num+1) SrNo FROM tblbets a INNER JOIN createmaster b ON a.UserId=b.mstrid
	WHERE ResultID IS NOT NULL AND MarketId = pMarketId AND MatchId = pMatchId  
	ORDER BY a.MstDate DESC ;

END IF;
