CREATE DEFINER=`placebet_Place36`@`%` PROCEDURE `getLogin` (IN `pUserId` VARCHAR(100), `pPassword` VARCHAR(100), `pIp` VARCHAR(100), `pSession` VARCHAR(100))  BEGIN 

DECLARE iType INT;
DECLARE sMsg VARCHAR(500);
DECLARE  LID INTEGER ; 
 DECLARE retMess VARCHAR(500);
DECLARE EXIT HANDLER FOR SQLEXCEPTION
  BEGIN
   SET iType = 5;
    GET DIAGNOSTICS CONDITION 1 @sqlstate = RETURNED_SQLSTATE, @errno = MYSQL_ERRNO, @text = MESSAGE_TEXT; 
    SET retMess = CONCAT("ERROR ", @errno, " (", @sqlstate, "): ", @text); 
    ROLLBACK;    
    SELECT iType, retMess;
END;
DECLARE EXIT HANDLER FOR SQLWARNING
 BEGIN
   SET iType = 6;
    GET DIAGNOSTICS CONDITION 1 @sqlstate = RETURNED_SQLSTATE, @errno = MYSQL_ERRNO, @text = MESSAGE_TEXT; 
    SET retMess = CONCAT("ERROR ", @errno, " (", @sqlstate, "): ", @text);     
    ROLLBACK;
    SELECT iType, retMess;
END;
 
START TRANSACTION;

if (EXISTS(select * from createmaster where mstruserid = pUserId and  mstrpassword = SHA1(pPassword)))then 
	if (EXISTS(select lgnusrCloseAc from createmaster where mstruserid = pUserId and  mstrpassword = SHA1(pPassword) and lgnusrCloseAc =0 )) then 
		SELECT 2 as iType,"Close User ..." as Msg;
	Elseif (EXISTS(select mstrlock from createmaster where mstruserid = pUserId and  mstrpassword = SHA1(pPassword) and mstrlock =0 )) then 
		SELECT 3 as iType,"Lock User ..." as Msg;
	Elseif (EXISTS(select mstrlock from createmaster where mstruserid = pUserId and  mstrpassword = SHA1(pPassword) and active =0 )) then 
		SELECT 4 as iType,"Login Failed ..." as Msg;
	Elseif (EXISTS(select lgnusrCloseAc from createmaster where mstruserid = pUserId and  mstrpassword = SHA1(pPassword) and mstrlock =1 and lgnusrCloseAc =1 and active =1 )) then 
		
		update userlogged a inner join createmaster b on a.loguser = b.mstrid and b.usetype =3
		set a.online = 0 where b.mstruserid = pUserId and a.online = 1 ;
 
		select mstrid ,NOW() ,1,pIp,pSession from createmaster where mstruserid = pUserId and  mstrpassword = SHA1(pPassword) and mstrlock =1 and lgnusrCloseAc =1 and active =1 ;
		 SET LID = LAST_INSERT_ID();
		
		update createmaster set loginstatus = pSession  where mstruserid = pUserId and  mstrpassword = SHA1(pPassword) and mstrlock =1 and lgnusrCloseAc =1 and active =1 ;

		select mstrid , mstrcrdate  ,mstrname ,mstruserid ,'' mstrpassword ,mobileno  ,mstrremarks  ,usetype  ,loginid  ,ipadress ,usecrdt ,parentId  ,mstrlock  ,partner  ,lgnusrlckbtng  ,lgnusrCloseAc  ,stakeLimit  ,Commission  ,lgnUserMaxProfit  ,lgnUserMaxLoss  ,lgnUserMaxStake  ,active  ,loginstatus,usemodt ,0 as iType,"Login Successfully ..." as Msg ,LID,chkupdatePass as ChangePas,set_timeout from createmaster where mstruserid = pUserId and  mstrpassword = SHA1(pPassword) and mstrlock =1 and lgnusrCloseAc =1 and active =1 ;
	else 
		SELECT 1 as iType,"Login Failed ..." as Msg;
	END IF;
else 
	SELECT 1 as iType,"Login Failed ..." as Msg;
End if;
 
    COMMIT;

	END$$

CREATE DEFINER=`placebet_Place36`@`%` PROCEDURE `getLoginUser` (IN `pUserid` INT, IN `pUserType` INT)  BEGIN 
set @num:=0;
IF pUserType = 2 THEN
	SELECT distinct crlgn.mstruserid, DATE(usrlgd.logstdt ) logstdt,usrlgd.ipadress 
	FROM userlogged usrlgd
	INNER JOIN createmaster crlgn ON usrlgd.loguser = crlgn.mstrid
	WHERE online = 1 and parentId= pUserid AND  DATE(logstdt) =DATE(NOW()) order by mstruserid;
ELSEIF pUserType = 1 THEN
	SELECT distinct crlgn.mstruserid, DATE(usrlgd.logstdt ) logstdt,usrlgd.ipadress 
	FROM userlogged usrlgd
	INNER JOIN createmaster crlgn ON usrlgd.loguser = crlgn.mstrid
	WHERE online = 1 AND parentId IN (SELECT Mstrid  FROM createmaster WHERE usetype = 2 AND parentID = pUserid) AND  DATE(logstdt) =DATE(NOW()) order by mstruserid;
ELSEIF pUserType = 0 THEN
	SELECT distinct crlgn.mstruserid, DATE(usrlgd.logstdt ) logstdt,usrlgd.ipadress 
	FROM userlogged usrlgd
	INNER JOIN createmaster crlgn ON usrlgd.loguser = crlgn.mstrid
	WHERE online = 1 AND  DATE(logstdt) =DATE(NOW()) order by mstruserid;
END IF;

	END$$

CREATE DEFINER=`placebet_Place36`@`%` PROCEDURE `GetMarket` (IN `pSportsId` INT, IN `pMatchID` INT, IN `pUserID` INT)  BEGIN
select * ,case when (select COUNT(*) from tblRights where UserID = pUserID and MatchID =a.MatchID and MarketID = a.ID )>0 then 1 else 0 end IsPlay,CASE WHEN (SELECT COUNT(*) FROM tblPlay WHERE UserID = pUserID AND MatchID =a.MatchID and isPlay = 1 and MarketID = a.ID )>0 THEN 1 ELSE 0 END IsPlayIcon
,(select COUNT(*) FROM matchfancy mf where mf.active !=2 and MatchID = pMatchID and mf.result is null) as FancyLen FROM market a where sportsId = pSportsId and active =1 and MatchID = pMatchID;
	END$$

