CREATE DEFINER=`placebet_Place36`@`%` PROCEDURE `getRateChange` (IN `pFancyID` INT)  BEGIN
select IFNULL(SUM(bet_value),0) TotalBet from bet_entry a
inner join matchfancy b on a.fncy_refId = b.MFancyID
