	END$$

CREATE DEFINER=`placebet_Place36`@`%` PROCEDURE `GetResult` ()  BEGIN
 SELECT matchName AS MatchName,c.Name AS MarketName,e.name AS sportName ,d.selectionName AS SelectionName, a.*  FROM tblresult a
INNER JOIN matchmst b ON a.matchId= b.MstCode 
INNER JOIN market c ON a.marketId=c.id 
INNER JOIN tblSelection d ON a.selectionId=d.selectionId AND a.marketId=d.marketId AND a.matchId =d.matchId 
INNER JOIN sportmst e ON a.sportId = e.id 
WHERE a.IsFancy <> 1 AND a.result = 1
UNION ALL 
SELECT matchName AS MatchName,'Session Fancy' AS MarketName,e.name AS sportName ,d.HeadName AS SelectionName, a.*  FROM tblresult a
INNER JOIN matchmst b ON a.matchId= b.MstCode  
INNER JOIN matchfancy d ON a.selectionId=d.Id AND a.matchId =d.matchId 
INNER JOIN sportmst e ON a.sportId = e.id 
WHERE a.IsFancy = 1 ;

	END$$

CREATE DEFINER=`placebet_Place36`@`%` PROCEDURE `InsPartner` (IN `pTypeID` INT, IN `pParentID` INT, IN `pUserID` INT, IN `pAdmin` DECIMAL, IN `pMaster` DECIMAL, IN `pDealer` DECIMAL)  NO SQL
BEGIN
 
DECLARE EXIT HANDLER FOR SQLEXCEPTION
  BEGIN
      ROLLBACK;
END;
DECLARE EXIT HANDLER FOR SQLWARNING
 BEGIN
     ROLLBACK;
END;
 
START TRANSACTION;
 
IF (SELECT Dealer FROM tblpartner WHERE UserID = pUserID AND TypeID = pTypeID) IS NULL THEN
     IF (pTypeID = 3) THEN  
		SELECT 3,pParentID,pUserID,Admin,MASTER,Dealer FROM tblpartner WHERE UserID = pParentID AND TypeID = 2;  
	ELSE 
			VALUES (pTypeID ,pParentID,pUserID,pAdmin,pMaster,pDealer);  
	END IF;
ELSE 
    UPDATE tblpartner SET Admin = pAdmin , MASTER = pMaster, Dealer = pDealer
	WHERE  UserID = pUserID AND TypeID = pTypeID ;  	

	IF pTypeID = 1 THEN
		UPDATE tblpartner SET Admin = pAdmin , MASTER = pMaster - Dealer
		WHERE  ParentID = pUserID AND TypeID = 2 ;  		
	END IF; 

END IF; 

COMMIT;

END$$

CREATE DEFINER=`placebet_Place36`@`%` PROCEDURE `SetMarquee` (IN `pMsg` VARCHAR(5000))  BEGIN
DECLARE  LID INTEGER ;
DECLARE resultV INT; DECLARE retMess VARCHAR(500);
DECLARE EXIT HANDLER FOR SQLEXCEPTION
  BEGIN
