CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_acStatement` (IN `pUserId` INT)  BEGIN
SET @runtot:=0;
select * from ( 
select T0.MstDate Sdate,T1.mstrUserId mstrUserId ,(T0.ChipsCr-T0.ChipsDr) Chips, T0.Narration Narration,T0.ChipsCr Credit,T0.ChipsDr Debit, '-1' IsBack,'0' as isFancy,(@runtot := @runtot + T0.ChipsCr - T0.ChipsDr) AS Balance from tblchipdet T0 INNER JOIN createmaster T1 On T1.mstrid =T0.UserID Where T0.UserId = pUserId
Union All
select T0.MstDate Sdate,T1.mstrUserId ,T0.Chips,T0.Narration ,(case when T0.Chips >0 then T0.Chips else 0 end) as Credit,(case when T0.Chips <= 0 then T0.Chips else 0 end) as Debit,'-1' as IsBack,'-1' as isFancy,ROUND((@runtot := @runtot + ifnull((case when T0.Chips >0 then T0.Chips else 0 end),0.0) + ifnull((case when T0.Chips < 0 then T0.Chips else 0 end),0.0)), 2) AS Balance
from TBLCHIPS T0 INNER JOIN createmaster T1 On T1.mstrid =T0.UserId Where T0.UserId = pUserId 
Union All
select T0.DateTime Sdate,T1.mstrUserId ,T0.Chips,Concat((select MatchName from matchmst Where MstCode= MatchId),':-',(Select k0.HeadName from matchfancy k0 Where k0.MatchId =T0.MatchId and T0.FancyId = K0.Id  ) )'Narration' ,
(case when T0.Chips >0 then T0.Chips else 0 end) as Credit,(case when T0.Chips < 0 then T0.Chips else 0 end) as Debit, Oddvalue as isBack,'1' as isFancy,ROUND((@runtot := @runtot + ifnull((case when T0.Chips >0 then T0.Chips else 0 end),0.0) + ifnull((case when T0.Chips <= 0 then T0.Chips else 0 end),0.0)), 2) AS Balance
from bet_entry T0 INNER JOIN createmaster T1 On T1.mstrid =T0.UserId Where T0.UserId = pUserId ) as t order by t.Sdate;

END$$

CREATE DEFINER=`placebet365`@`localhost` PROCEDURE `sp_BetChipSumm` (IN `p_nodeId` INT, IN `p_nodeTp` INT)  BEGIN
	IF p_nodeTp = 0 THEN
		SELECT sum(ct.chips) as chipsBal, ct.isFree, bt.mstrid, bt.mstruserid, bt.mstrname FROM createmaster bt inner join createmaster dt on dt.ParentId = bt.mstrid inner join createmaster mt on mt.mstrid = dt.ParentId inner join tblchips ct on ct.UserID = mt.mstrid WHERE bt.ParentID = p_nodeId group by ct.isFree, bt.mstrid, bt.mstruserid, bt.mstrname;
	else 
    if p_nodeTp = 1 then	
		SELECT sum(ct.chips) as chipsBal, ct.isFree, bt.mstrid, bt.mstruserid, bt.mstrname  FROM createmaster bt inner join createmaster mt on mt.mstrid = bt.ParentId inner join tblchips ct on ct.userid = mt.mstrid  WHERE bt.ParentID = p_nodeId  ;
	else 
    if p_nodeTp = 2 then	
		SELECT sum(ct.chips) as chipsBal, ct.isFree, bt.mstrid, bt.mstruserid, bt.mstrname  FROM createmaster bt inner join tblchips ct on ct.userid = bt.mstrid  WHERE bt.ParentID = p_nodeId ;
	end if;
    end if;
    end if;
 END$$

