	CASE WHEN OddValue = 1 THEN 
		CASE WHEN OddsNumber <=  Yes THEN - Bet_value 
		ELSE Bet_value END 
	ELSE 
		CASE WHEN OddsNumber > Yes THEN - Bet_value 
		ELSE Bet_value END 
