CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_MasterAcStatement` (IN `pUserId` INT)  BEGIN
SET @runtot:=0;
select * from (

select T0.MstDate Sdate,T1.mstrUserId ,T0.Chips,T0.Narration ,ifnull((Select l1.Chips from TBLCHIPS l1 Where l1.UserId = T0.UserId and l1.Crdr = 1 and L1.MstDate= T0.Mstdate ),0.0) 'Credit'
,ifnull((Select l1.Chips from TBLCHIPS l1 Where l1.UserId = T0.UserId and l1.Crdr = 2 and L1.MstDate= T0.Mstdate ),0.0) 'Debit','-1' as IsBack,'-1' as isFancy,ROUND((@runtot := @runtot + ifnull((Select l1.Chips from TBLCHIPS l1 Where l1.UserId = T0.UserId and l1.Crdr = 1 and L1.MstDate= T0.Mstdate ),0.0) + ifnull((Select l1.Chips from TBLCHIPS l1 Where l1.UserId = T0.UserId and l1.Crdr = 2 and L1.MstDate= T0.Mstdate ),0.0)), 2) AS Balance
from TBLCHIPS T0
INNER JOIN createmaster T1 On T1.mstrid =T0.UserId
Where T0.UserId = pUserId
Union All
select 
	T0.MstDate Sdate,T1.mstrUserId mstrUserId ,(T0.ChipsCr-T0.ChipsDr) Chips, T0.Narration Narration,
	T0.ChipsCr Credit,T0.ChipsDr Debit, '-1' IsBack,'0' as isFancy,(@runtot := @runtot + T0.ChipsCr - T0.ChipsDr) AS Balance 
from tblchipdet T0 INNER JOIN createmaster T1 On T1.mstrid =T0.UserID Where T0.UserId = pUserId ) as t order by t.Sdate;

END$$

