    CREATE TEMPORARY TABLE finalList ( nodeSr INTEGER NOT NULL  , mstruserid VARCHAR(50),mstrname VARCHAR(50), mstrid INTEGER , mstrlock INTEGER, usetype INTEGER, parentid INTEGER, leveNo INTEGER, mstrcrdate DATETIME ,lgnusrlckbtng TINYINT,lgnusrCloseAc  TINYINT,Commission decimal(5,2),partner decimal(5,2),lgnUserMaxStake INTEGER,lgnUserMaxProfit INTEGER ,lgnUserMaxLoss INTEGER,SessionComm decimal(5,2),OtherComm decimal(5,2),set_timeout INTEGER,InPlayStack INTEGER) ;

    CREATE TEMPORARY TABLE processLists ( mstruserid VARCHAR(50),mstrname VARCHAR(50), mstrid INTEGER , mstrlock INTEGER, usetype INTEGER, parentid INTEGER, leveNo INTEGER, mstrcrdate DATETIME,lgnusrlckbtng TINYINT,lgnusrCloseAc  TINYINT,Commission decimal(5,2),partner decimal(5,2),lgnUserMaxStake INTEGER,lgnUserMaxProfit INTEGER ,lgnUserMaxLoss INTEGER,SessionComm decimal(5,2),OtherComm decimal(5,2),set_timeout INTEGER,InPlayStack INTEGER) ;  

    CREATE TEMPORARY TABLE  tmpList (mstruserid VARCHAR(50),mstrname VARCHAR(50), mstrid INTEGER , mstrlock INTEGER, usetype INTEGER, parentid INTEGER, leveNo INTEGER, mstrcrdate DATETIME,lgnusrlckbtng TINYINT,lgnusrCloseAc  TINYINT,Commission decimal(5,2),partner decimal(5,2),lgnUserMaxStake INTEGER,lgnUserMaxProfit INTEGER ,lgnUserMaxLoss INTEGER,SessionComm decimal(5,2),OtherComm decimal(5,2),set_timeout INTEGER,InPlayStack INTEGER) ;  



   INSERT  finalList  (nodeSr, mstruserid,mstrname , mstrid, mstrlock, usetype, parentid, leveNo, mstrcrdate,lgnusrlckbtng,lgnusrCloseAc,Commission,partner,lgnUserMaxStake,lgnUserMaxProfit,lgnUserMaxLoss,SessionComm,OtherComm,set_timeout,InPlayStack)

   SELECT 0,  mstruserid,mstrname, mstrid, mstrlock, usetype, parentid, 0, bt.mstrcrdate,lgnusrlckbtng,lgnusrCloseAc,Commission, partner,lgnUserMaxStake,lgnUserMaxProfit,lgnUserMaxLoss,SessionComm,OtherComm,set_timeout,InPlayStack FROM createmaster bt WHERE bt.lgnusrCloseAc =1 and bt.mstrid= p_nodeId  ;  

	if p_helper <> 0 then

	   INSERT  processLists SELECT mstruserid,mstrname, mstrid, mstrlock, usetype, bt.parentid, 1, bt.mstrcrdate,lgnusrlckbtng,lgnusrCloseAc,Commission, partner,lgnUserMaxStake,lgnUserMaxProfit,lgnUserMaxLoss,SessionComm,OtherComm ,set_timeout,InPlayStack FROM createmaster bt inner join tblHelper th on bt.mstrid = th.masterid  WHERE bt.lgnusrCloseAc =1 and bt.ParentID= p_nodeId and th.Helperid = p_helper ORDER BY mstrid ;  

	else

		INSERT  processLists SELECT mstruserid,mstrname, mstrid, mstrlock, usetype, bt.parentid, 1, bt.mstrcrdate,lgnusrlckbtng,lgnusrCloseAc,Commission, partner,lgnUserMaxStake,lgnUserMaxProfit,lgnUserMaxLoss,SessionComm,OtherComm,set_timeout,InPlayStack  FROM createmaster bt WHERE bt.lgnusrCloseAc =1 and bt.ParentID= p_nodeId ORDER BY mstrid ;  	

	end if;



   INSERT  tmpFinalList ( mstruserid,mstrname, mstrid, mstrlock, usetype, parentid, leveNo, mstrcrdate,lgnusrlckbtng,lgnusrCloseAc,Commission, partner,lgnUserMaxStake,lgnUserMaxProfit,lgnUserMaxLoss,SessionComm,OtherComm,set_timeout,InPlayStack ) SELECT * FROM  processLists ;      

     SET ctr := (SELECT  COUNT(*) AS ctrs FROM  tmpFinalList) ;  

     IF  ctr = 0 THEN        

      BEGIN        

         SET  bFlag = 0  ;       

      END;       

      END IF ;

   WHILE bFlag = 1  DO        

   BEGIN          

		SET  leveC =  leveC + 1 ;             

       BEGIN          

		 DECLARE tree_cursor1 CURSOR    

		 FOR SELECT * FROM  processLists ; 

		 DECLARE CONTINUE HANDLER FOR NOT FOUND SET finished = 1 ;

		 SET finished = 0 ;			     

		 OPEN tree_cursor1 ;

		 innerLoop1: REPEAT

		 BEGIN 

			FETCH tree_cursor1 INTO m_userId,m_userName, m_nodeId ,  m_paid,  m_bone,  m_pareId,  m_leveNo,  m_nodeDt,m_lgnlck ,m_lgncls,m_commision,m_partnership,m_stakelimit,m_maxprof,m_maxloss,m_sescomm,m_othcomm,mset_timeout,m_inplaystack;



			IF finished THEN

				LEAVE innerLoop1;

			END IF;

			  INSERT  tmpList SELECT mstruserid,mstrname, mstrid, mstrlock, usetype, bt.parentid, 1,  mstrcrdate ,lgnusrlckbtng,lgnusrCloseAc,Commission,partner,lgnUserMaxStake,lgnUserMaxProfit,lgnUserMaxLoss ,SessionComm,OtherComm,set_timeout,InPlayStack

			  FROM createmaster bt  WHERE bt.lgnusrCloseAc =1 and bt.ParentID= m_nodeId ORDER BY mstrid ;   

		 END;        

		 UNTIL finished

		 END REPEAT ;

		 CLOSE tree_cursor1 ;

		 SET finished = 0; 

        END;

        SET ctr := (SELECT COUNT(*) AS ctrs FROM  tmpList) ;                   

		IF  ctr = 0 THEN         

		BEGIN        

		   SET  bFlag = 0  ;      

		   DELETE FROM  processLists ;        

		   DELETE FROM  tmpList ;       

		END;        

		ELSE      

		   BEGIN  

			  INSERT  tmpFinalList ( mstruserid,mstrname, mstrid, mstrlock, usetype, parentid, leveNo, mstrcrdate,lgnusrlckbtng,lgnusrCloseAc,Commission,partner,lgnUserMaxStake,lgnUserMaxProfit,lgnUserMaxLoss,SessionComm,OtherComm,set_timeout,InPlayStack) SELECT * FROM  tmpList ;  

			  DELETE FROM  processLists ; 

			  INSERT  processLists SELECT * FROM  tmpList ; 

			  DELETE FROM  tmpList  ;      

		   END ;                  

		 END IF ; 

	END;

	END WHILE;

	INSERT  finalList  (nodeSr, mstruserid,mstrname, mstrid, mstrlock, usetype, parentid, leveNo, mstrcrdate,lgnusrlckbtng,lgnusrCloseAc,Commission,partner,lgnUserMaxStake,lgnUserMaxProfit,lgnUserMaxLoss,SessionComm,OtherComm,set_timeout,InPlayStack)   SELECT * FROM tmpFinalList ORDER BY mstrcrdate, mstrid ;      

		SELECT case when b.TypeID = 1 then b.Master else b.Dealer end partner ,a.*,

     CASE WHEN usetype=0 AND mstrlock=0 THEN 'app/dist/img/lock_file.png' 

ELSE CASE WHEN usetype=0 AND mstrlock=1 THEN 'app/dist/img/file.png' 

ELSE CASE WHEN usetype=1 AND mstrlock=0 THEN 'app/dist/img/lock_master.png' 

ELSE CASE WHEN usetype=1 AND mstrlock=1 THEN 'app/dist/img/master.png'

ELSE CASE WHEN usetype=2 AND mstrlock=0 THEN 'app/dist/img/lock_dealer.png' 

ELSE CASE WHEN usetype=2 AND mstrlock=1 THEN 'app/dist/img/dealer.png' 

ELSE CASE WHEN usetype=3 AND mstrlock=0 THEN 'app/dist/img/lock_user.png' 

ELSE CASE WHEN usetype=3 AND mstrlock=1 THEN 'app/dist/img/user.png'

END END END END END END END END AS image FROM finalList a left join tblpartner b on a.mstrid = b.UserID 



order by parentid,mstruserid; 

 END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_multimarketoddsBets` (IN `puserid` INT, IN `pmatchid` INT)  BEGIN
select tbs.Stack,tbs.IsMatched as matchVal,case when tbs.IsMatched=0 then "UnMatched" else "Matched" end ismatched, tbs.MstCode, m.Name,case when tbs.isBack=0 then "Back" else "Lay" end isBack ,tbs.UserId,tbs.MarketId,tbs.SelectionId,tbs.selectionName,tbs.Odds,tbs.P_L from tblbets tbs inner join market m on tbs.MatchId=m.matchId and tbs.MarketId=m.Id and tbs.Result is null and tbs.UserId=puserid and tbs.MatchId=pmatchid and m.active=1 order by tbs.MstCode desc;

END$$

CREATE DEFINER=`placebet365`@`localhost` PROCEDURE `SP_OddsProfitLoss` (IN `p_userId` INT, IN `p_marketId` VARCHAR(20))  NO SQL
BEGIN
	select  *, 
ifnull((select  (ifnull(sum(case when isBack = 0 then p_l else -p_l end),0)*ifnull(partner,0)) /100 from 
tblbets a inner join createmaster b on  a.UserId = b.MstrID where SelectionId = tblSelection.selectionId and MarketId = tblSelection.marketId and UserId=p_userId and IsMatched=1), 0) as winValue, 
ifnull((select (ifnull(sum(case when isBack = 0 then stack else -stack end),0)*ifnull(partner,0)) /100 from tblbets a inner join createmaster b on  a.UserId = b.MstrID where SelectionId <> tblSelection.selectionId and MarketId = tblSelection.marketId and UserId=p_userId and IsMatched=1),0) as lossValue
from tblSelection where MarketId = p_marketId;
 END$$

CREATE DEFINER=`placebet_Place36`@`%` PROCEDURE `SP_OddsProfitLossNew` (IN `p_userId` INT, IN `p_userType` INT, IN `p_matchId` INT, IN `p_marketId` VARCHAR(20))  NO SQL
BEGIN 
	if (p_userType = 3) then
		select ifnull(sum(winValue), 0) as winValue, IFNULL(sum(lossValue), 0) as lossValue, matchId, SelectionId, MarketId, selectionName  from vewUserPnlDetails  where userId = p_userId and marketId = p_marketId and matchId = p_matchId group by matchId, SelectionId, MarketId, selectionName;
    else if (p_userType = 2) then
		select IFNULL(sum(winValue * -1 * Dealer / 100 ), 0) as winValue, IFNULL(sum(lossValue * -1 * Dealer / 100), 0)   as lossValue, matchId, SelectionId, MarketId, selectionName from vewUserPnlDetails a inner join createmaster b on b.mstrid = a.UserId   where parantId = p_userId and marketId = p_marketId and matchId = p_matchId group by matchId, SelectionId, MarketId, selectionName;
    else if (p_userType = 1) then
		select IFNULL(sum(winValue * -1 * Master / 100), 0) as winValue, IFNULL(sum(lossValue * -1 * Master / 100), 0)  as lossValue, matchId, SelectionId, MarketId, selectionName from vewUserPnlDetails a inner join createmaster b on b.mstrid = a.UserId inner join createmaster c on c.mstrid = a.parantid   where c.ParentID = p_userId and marketId = p_marketId and matchId = p_matchId group by matchId, SelectionId, MarketId, selectionName;
	else
		select IFNULL(sum(winValue * -1 * Admin / 100), 0) as winValue, IFNULL(sum(lossValue * -1 * Admin / 100), 0)  as lossValue, matchId, SelectionId, MarketId, selectionName from vewUserPnlDetails a inner join createmaster b on b.mstrid = a.UserId   where marketId = p_marketId and matchId = p_matchId group by matchId, SelectionId, MarketId, selectionName;
	end if;
    end if;
    end if;
END$$

CREATE DEFINER=`placebet_Place36`@`%` PROCEDURE `sp_P&L_ChipSumm_M` (IN `pUserID` INT, IN `pMatchID` INT, IN `pMarketID` INT, IN `pFancyID` INT)  BEGIN
SET @Type = pTypeID;
	SELECT b.mstrid UserID, usetype, mstruserid, CONCAT(case when ChildID = 0 then 'Parent' else mstrname end, ' A/c') mstrname, ROUND(SUM(a.ChipsCr-a.ChipsDr),2) Musum, 0 as msttype, ChildID from tblchipdet a inner join createmaster b on b.mstrid = a.oppAcID  where a.UserID = pUserID and a.MarketId = pMatchID and a.MatchId = pMarketID  and IFNULL(a.FancyId ,0) = pFancyID  group by b.mstrid, usetype, mstruserid, mstrname, ChildID having SUM(a.ChipsCr-a.ChipsDr) > 0
	union
	SELECT b.mstrid UserID, usetype, mstruserid, CONCAT(CASE WHEN ChildID = 0 THEN 'Parent' ELSE 'Own ' END, ' Commission') mstrname, ROUND(SUM(a.ChipsDr-a.ChipsCr),2) Musum, 6 msttype, 0 as ChildID FROM tblchipdet a INNER JOIN createmaster b ON b.mstrid = a.UserID  WHERE a.UserID = pUserID and a.MarketId = pMatchID and a.MatchId = pMarketID and IFNULL(a.FancyId ,0) = pFancyID  AND msttype in (6) GROUP BY b.mstrid, usetype, mstruserid, CONCAT(CASE WHEN ChildID = 0 THEN 'Parent' ELSE 'Own ' END, ' Commission') HAVING SUM(a.ChipsDr-a.ChipsCr) > 0
	UNION
	SELECT b.mstrid UserID, usetype, mstruserid, 'Cash' mstrname, ROUND(SUM(a.ChipsDr-a.ChipsCr),2) Musum, 0 as msttype, 0 as ChildID FROM tblchipdet a INNER JOIN createmaster b ON b.mstrid = a.UserID  WHERE a.UserID = pUserID and a.MarketId = pMatchID and a.MatchId = pMarketID and IFNULL(a.FancyId ,0) = pFancyID  AND msttype >= 50 GROUP BY b.mstrid, usetype, mstruserid, mstrname HAVING SUM(a.ChipsDr-a.ChipsCr) > 0
	UNION 	
	SELECT b.mstrid UserID, usetype, mstruserid, 'Own' mstrname, ROUND(SUM(a.ChipsDr-a.ChipsCr),2) Musum, 0 as  msttype, 0 as ChildID  from tblchipdet a inner join createmaster b on b.mstrid = a.UserID where a.UserID = pUserID and a.MarketId = pMatchID and a.MatchId = pMarketID and IFNULL(a.FancyId ,0) = pFancyID  and msttype not in (6, 50)  group by b.mstrid, usetype, mstruserid, mstrname having SUM(a.ChipsDr-a.ChipsCr) > 0
	;    
	
END$$

CREATE DEFINER=`placebet_Place36`@`%` PROCEDURE `sp_PlaceBet` (IN `pLogInId` INT, IN `pUserId` INT, IN `pParantId` INT, IN `pMatchId` INT, IN `pSelectionId` INT, IN `pStack` INT, IN `pMarketId` VARCHAR(100), IN `pselectionName` VARCHAR(100), IN `pMstDate` DATETIME, IN `pOdds` DECIMAL(10,2), IN `pP_L` DECIMAL(10,2), IN `pisBack` INT, IN `pIsMatched` INT, IN `pNarration` VARCHAR(200), IN `pdeviceInfo` VARCHAR(100), IN `pIP_ADDESSS` VARCHAR(100), IN `pInPlayStack` INT, IN `pIsApp` INT)  BEGIN
DECLARE  LID INTEGER; DECLARE lCtr integer ;
DECLARE resultV INT; DECLARE retMess VARCHAR(500);
DECLARE checkBal decimal(50,2);
DECLARE EXIT HANDLER FOR SQLEXCEPTION
  BEGIN
        set resultV = -1;
    GET DIAGNOSTICS CONDITION 1 @sqlstate = RETURNED_SQLSTATE, @errno = MYSQL_ERRNO, @text = MESSAGE_TEXT; 
    SET retMess = CONCAT("ERROR ", @errno, " (", @sqlstate, "): ", @text); 
    ROLLBACK;    
    select resultV, retMess;
END;
DECLARE EXIT HANDLER FOR SQLWARNING
 BEGIN
        set resultV = -2;
    GET DIAGNOSTICS CONDITION 1 @sqlstate = RETURNED_SQLSTATE, @errno = MYSQL_ERRNO, @text = MESSAGE_TEXT; 
    SET retMess = CONCAT("ERROR ", @errno, " (", @sqlstate, "): ", @text);     
    ROLLBACK;
    SELECT resultV, retMess;
END; 

MainLabel:BEGIN
DECLARE InStack INTEGER ; 
DECLARE InTotalStack INTEGER ;
DECLARE playpause INTEGER;
set playpause=(select case when (select COUNT(*) from tblRights where UserID = pUserId and MatchID =pMatchId and MarketID = pMarketId )>0 then 1 else 0 end IsPlay);

set InTotalStack = pStack + (select IFNULL(SUM(Stack),0)Stack from tblbets where userid=pUserId and MatchId = pMatchId and MarketId = pMarketId);
set InStack = (select IFNULL(InPlayStack,0)InPlayStack from createmaster where mstrid = pUserId);
IF pInPlayStack = 1 and InTotalStack >InStack and InStack > 0  THEN
	SET resultV = -4;
	SET retMess =CONCAT("Check Stack Limit In InPlay ...", InStack);   
	SELECT resultV, retMess;
    LEAVE MainLabel;
END IF;
IF playpause = 1 THEN
	SET resultV = -4;
	SET retMess =CONCAT("Market is Pause", playpause);   
	SELECT resultV, retMess;
    LEAVE MainLabel;
END IF;
 
SET resultV = 0; 
SET lCtr = (SELECT COUNT(*) FROM tblpartner WHERE UserID = pUserId);
if lCtr = 0 then
	SET resultV = -3;
	SET retMess = CONCAT("ERROR ", "No Partner for user");     
	SELECT resultV, retMess;    
END IF;
IF lCtr > 0 THEN
	START TRANSACTION;


SELECT pLogInId , pUserId , a.parentid , pMatchId , pSelectionId , pStack, pMarketId, pselectionName, pMstDate, pOdds, pP_L, pisBack, pIsMatched ,pdeviceInfo,pIP_ADDESSS , 0,Admin , MASTER ,Dealer ,pIsApp FROM  createmaster a 
inner join tblpartner b on a.mstrid = b.UserID   
WHERE a.useType = 3 and a.mstrid = pUserId ;


		 
	
	set checkBal=(SELECT ROUND(IFNULL(c.Chips,0) + IFNULL(j.ChipBal, 0) +  case when ROUND(IFNULL(i.Liability, 0) + IFNULL(L.Liability, 0) + 
	IFNULL(N.Liability, 0) + IFNULL(k.Liability, 0) + IFNULL(M.Liability, 0) + IFNULL(O.Liability, 0) + IFNULL(qryOddEven.Liability, 0), 2) < 0 then
	 ROUND(IFNULL(i.Liability, 0) + IFNULL(L.Liability, 0) + IFNULL(N.Liability, 0) + IFNULL(k.Liability, 0) + IFNULL(M.Liability, 0)+ 
	 IFNULL(O.Liability, 0) + IFNULL(qryOddEven.Liability, 0), 2) else 0 end ,2) Balance 
	 FROM  
	(SELECT SUM(P_L)Lay FROM tblbets  WHERE isBack = 1 AND UserId = pUserId AND Result IS NULL AND ResultID IS NULL)  a , 	(SELECT  SUM(Stack)Stack FROM tblbets WHERE isBack = 0 AND  UserId = pUserId AND Result IS NULL AND ResultID IS NULL)b , 	(SELECT  SUM(Chips)Chips FROM tblchips WHERE IsFree = 1 AND ResultID IS NULL AND BetID IS NULL AND UserID =   pUserId )c ,
	( SELECT SUM(a.ChipsCr-a.ChipsDr) Chips FROM tblchipdet a WHERE a.UserID =  pUserId) d ,
	(SELECT IFNULL(SUM(P_L),0 )P_L FROM `tblbets` WHERE result =1 AND isBack = 0 AND UserID = pUserId)e,
	(SELECT IFNULL(SUM(-P_L),0 )P_L FROM `tblbets` WHERE result =1 AND isBack = 1 AND UserID = pUserId)f,
	(SELECT IFNULL(SUM(-Stack),0 )P_L FROM `tblbets` WHERE result =0 AND isBack = 0 AND UserID = pUserId)g,
	(SELECT IFNULL(SUM(Stack),0 )P_L FROM `tblbets` WHERE result =0 AND isBack = 1 AND UserID = pUserId)h,
	(Select sum(X .mSum)Liability from(select min(a.pnlvalue)'mSum' from (SELECT SUM(winValue + lossValue) pnlvalue, matchId, MarketId, SelectionId 
FROM vewUserPnlDetails WHERE userId =  pUserId GROUP BY matchId, MarketId, SelectionId )a Where a.pnlvalue<0  group by MarketId)X ) i , 
    (SELECT  SUM(IFNULL(ChipsCr, 0) - IFNULL(ChipsDr, 0)) ChipBal FROM tblchipdet WHERE UserID =   pUserId )j, 
    (SELECT SUM(minvalue) Liability  FROM (SELECT MIN(pnlvalue) minvalue, matchId, MarketId FROM (SELECT SUM(aa) pnlvalue, matchId, fancyid  MarketId, yes SelectionId FROM vewsessionliability WHERE userId =  pUserId GROUP BY yes,  matchId, fancyid) X GROUP BY matchId, MarketId)  Y) k,  
	(select SUM(bet_value)*-1  Liability from  `bet_entry` where TypeID in (3) and ResultID is null and userid =  pUserId )L,   
    (SELECT SUM(minvalue)  Liability  FROM (SELECT MIN(pnlvalue) minvalue, matchId, MarketId FROM (SELECT SUM(aa) pnlvalue, matchId, fancyid  MarketId, runvalue SelectionId FROM vewUpDownliability WHERE userId = pUserId GROUP BY runvalue,  matchId, fancyid) X1 GROUP BY matchId, MarketId)  Y1) M,
    (select SUM(bet_value )*-1 Liability  from  `bet_entry` a inner join matchfancy b on a.fancyId = b.ID where a.TypeID = 4 and ResultID is null and userid =  pUserId)N,
	(SELECT SUM(winValue) Liability  FROM  vewUserPnlUnMOnly WHERE userId =  pUserId ) O,
	(select ifnull(Liability, 0) * case when ifnull(Liability, 0) > 0 then -1 else 1 end Liability from (select SUM(case when OddValue = 1 then 1 else -1 end * bet_value) Liability from `bet_entry` where TypeID in (1) and ResultID is null and userid =  pUserId) qryOEinner) qryOddEven);
	IF checkBal >= 0 THEN
		COMMIT;
		SET resultV = 0;
		SET retMess = "Saved Successfully...";
		SELECT resultV, retMess;
	end if ;
	IF checkBal < 0 THEN
		ROLLBACK;
		SET resultV = -6;
		SET retMess =CONCAT("Insufficient Bal After Place Bet Balance is", checkBal,"and P&L is ",pP_L,'Odds Is ',pOdds);
        SELECT resultV, retMess;
	end if ;
	
end if ;

End;
END$$

CREATE DEFINER=`placebet_Place36`@`%` PROCEDURE `sp_PlaceBet_Fancy` (IN `pbet_value` INT, IN `pOddValue` VARCHAR(30), IN `pOddsNumber` INT, IN `pTypeID` INT, IN `pmatchId` INT, IN `pfancyId` INT, IN `pparantId` INT, IN `puserId` INT, IN `pdateTime` DATETIME, IN `ploginid` INT, IN `pfncy_refId` INT, IN `pFheadName` VARCHAR(200), IN `pSessInpYes` INT, IN `pSessInpNo` INT, IN `psportId` INT, IN `pIP_ADDRESS` VARCHAR(200), IN `pponitDiff` INT, IN `pDeviceDesc` VARCHAR(50), IN `pResultID` INT)  BEGIN
