  BEGIN
        set resultV = -1;
    GET DIAGNOSTICS CONDITION 1 @sqlstate = RETURNED_SQLSTATE, @errno = MYSQL_ERRNO, @text = MESSAGE_TEXT; 
    SET retMess = CONCAT("ERROR ", @errno, " (", @sqlstate, "): ", @text); 
    ROLLBACK;    
    select resultV, retMess;
END;
DECLARE EXIT HANDLER FOR SQLWARNING
 BEGIN
        set resultV = -2;
    GET DIAGNOSTICS CONDITION 1 @sqlstate = RETURNED_SQLSTATE, @errno = MYSQL_ERRNO, @text = MESSAGE_TEXT; 
    SET retMess = CONCAT("ERROR ", @errno, " (", @sqlstate, "): ", @text);     
