CREATE DEFINER=`placebet_Place36`@`%` PROCEDURE `SP_SetResult` (IN `pSportsID` INT, IN `pMatchID` INT, IN `pMarketID` VARCHAR(200), IN `pSelectionID` INT, IN `pFancyID` INT, IN `pResult` INT, IN `pSportsNM` TEXT, IN `pMatchNM` TEXT, IN `pMarketNM` TEXT, IN `pSelectionNM` TEXT)  BEGIN
DECLARE  LID INTEGER ;
DECLARE resultV INT; DECLARE retMess VARCHAR(500);
DECLARE  chkMarket INTEGER ;
DECLARE EXIT HANDLER FOR SQLEXCEPTION
  BEGIN
   SET resultV = -1;
    GET DIAGNOSTICS CONDITION 1 @sqlstate = RETURNED_SQLSTATE, @errno = MYSQL_ERRNO, @text = MESSAGE_TEXT; 
    SET retMess = CONCAT("ERROR ", @errno, " (", @sqlstate, "): ", @text); 
    ROLLBACK;    
    SELECT resultV, retMess;
END;
DECLARE EXIT HANDLER FOR SQLWARNING
 BEGIN
   SET resultV = -2;
    GET DIAGNOSTICS CONDITION 1 @sqlstate = RETURNED_SQLSTATE, @errno = MYSQL_ERRNO, @text = MESSAGE_TEXT; 
    SET retMess = CONCAT("ERROR ", @errno, " (", @sqlstate, "): ", @text);     
    ROLLBACK;
    SELECT resultV, retMess;
END;
MainLabel:BEGIN
IF (SELECT result FROM tblresult WHERE sportId = pSportsID AND matchId = pMatchID AND marketId = pMarketID ) IS NOT NULL THEN
	SET resultV = 3;
	SET retMess = 'Already Saved ...';
	SELECT resultV, retMess;
    LEAVE MainLabel;
END IF;
IF pSportsID=0 THEN
	SET resultV = 3;
	SET retMess = 'Already Saved ...';
	SELECT resultV, retMess;
    LEAVE MainLabel;
END IF; 
START TRANSACTION;
  
 SET LID = LAST_INSERT_ID();
 
UPDATE tblbets SET Result = CASE WHEN isBack = 0 THEN 1 ELSE 0 END, ResultID =LID, Chips = CASE WHEN isBack = 0 THEN P_L ELSE -P_L END WHERE IsMatched = 1 AND MatchId =pMatchID AND MarketId =pMarketID AND SelectionId = pSelectionID ;
UPDATE tblbets SET Result = CASE WHEN isBack = 0 THEN 0 ELSE 1 END,ResultID=LID, Chips = CASE WHEN isBack = 0 THEN -Stack ELSE Stack END WHERE  IsMatched = 1 AND  MatchId =pMatchID AND MarketId =pMarketID AND SelectionId <> pSelectionID  ;
UPDATE tblbets SET Result = -1, ResultID =LID, Chips = 0 WHERE IsMatched = 0 AND MatchId =pMatchID AND MarketId =pMarketID ;

SELECT NOW() ,UserID , 0 ,1, CASE WHEN pnl > 0 THEN ROUND(pnl, 2) ELSE 0 END, CASE WHEN pnl < 0 THEN ROUND(ABS(pnl), 2) ELSE 0 END, LID ,0 ,CONCAT(pMatchNM ,' ', pMarketNM  , CASE WHEN pnl >= 0 THEN ' Profit ' ELSE ' Loss ' END , ' [ Winner : ', pSelectionNM , ' ]') ,pSportsNM , 5, pMatchID ,pMarketID, 0, MASTER, dealer, admin, parantid, 0, parantId, 'Parent' FROM (SELECT UserID,MASTER, dealer, admin, parantid, SUM(Chips) pnl FROM tblbets WHERE IsMatched =1 AND MatchId =pMatchID AND MarketId =pMarketID   GROUP BY  UserID ,MASTER, dealer, admin, parantid) X  ;
SELECT  MstDate , UserID, 1, 1, 0, ROUND((a.ChipsCr*Commission)/100, 2) Comm, ResultID ,BetID,CONCAT(pMatchNM ,' ', pMarketNM  ,' Commission [ Winner : ', pSelectionNM , ' ]' ) ,pSportsNM , 6, pMatchID, pMarketID, 0, pMaster, pDealer, pAdmin, b.parentId, 0, parantId, 'Parent Commission' FROM  tblchipdet a
INNER JOIN createmaster b ON a.UserID = b.MstrId WHERE a.MatchId =pMatchID AND a.MarketId =pMarketID AND a.ChipsCr>0 AND ChildID = 0 AND  msttype = 5;

SELECT MstDate , b.mstrid ,1 ,1, CASE WHEN SUM(a.ChipsCr-a.ChipsDr) < 0 THEN ROUND(ABS(SUM(a.ChipsCr-a.ChipsDr)), 2) ELSE 0 END, CASE WHEN SUM(a.ChipsCr-a.ChipsDr) > 0 THEN ROUND(ABS(SUM(a.ChipsCr-a.ChipsDr)), 2) ELSE 0 END, LID, BetID ,CONCAT(pMatchNM ,' ', pMarketNM  ,   ' From  ', c.MstrUserId , ' ]') ,pSportsNM ,5 ,pMatchID ,pMarketID, UserID, 0, 0, 0, b.parentId, 1, userId, 'Client A/c' FROM tblchipdet a 
INNER JOIN createmaster b ON a.parantid = b.MstrId 
INNER JOIN createmaster c ON a.userid = c.MstrId 
WHERE MatchId =pMatchID AND MarketId =pMarketID  AND levelV = 0 and msttype = 5 GROUP BY MstDate , b.mstrid ,LID,BetID, c.MstrUserId, UserID, b.parentId;

SELECT MstDate ,b.mstrid ,1 ,1, ROUND(ABS(SUM(a.ChipsCr-a.ChipsDr)), 2) , 0, LID, BetID ,CONCAT(' Commission On ', pMatchNM ,' ', pMarketNM  ,   ' From ', c.MstrUserId , ' ]') ,pSportsNM , 6, pMatchID ,pMarketID, UserID, 0, 0, 0, b.parentId, 1, userId, 'Client Commission' FROM    tblchipdet a 
INNER JOIN createmaster b ON a.parantid = b.MstrId 
INNER JOIN createmaster c ON a.UserID = c.MstrId 
WHERE MatchId =pMatchID AND MarketId =pMarketID  AND levelV = 0 AND msttype = 6 GROUP BY MstDate ,b.mstrid ,LID,BetID, c.MstrUserId, UserID, b.parentId HAVING SUM(a.ChipsCr-a.ChipsDr) < 0;

SELECT mstdate, b.mstrid , 1, 1, 0, ROUND(ROUND(ABS(SUM((a.ChipsCr-a.ChipsDr)* b.Commission / 100)), 4) , 2) Comm , LID , BetID,CONCAT(pMatchNM ,' ', pMarketNM  ,' Commission Dealer To Master [ Winner : ', pSelectionNM , ' ]' ) , pSportsNM ,6, pMatchID ,pMarketID, 0, 0, 0, 0, b.parentId, 1 , b.parentId, 'Parent Commission' FROM  tblchipdet a 
INNER JOIN createmaster b ON a.parantid = b.MstrId
WHERE  a.MatchId =pMatchID AND a.MarketId =pMarketID AND levelV = 0 AND msttype = 5  GROUP BY MstDate ,b.mstrid ,LID,BetID, b.MstrUserId, b.parentId HAVING SUM(a.ChipsCr-a.ChipsDr) > 0;

SELECT mstdate, b.mstrid , 1, 1, CASE WHEN SUM(a.ChipsCr-a.ChipsDr) > 0 THEN ROUND(ABS(SUM((a.ChipsCr-a.ChipsDr) * (pMaster+pAdmin) / 100)), 2)  ELSE 0 END, CASE WHEN SUM(a.ChipsCr-a.ChipsDr) < 0 THEN ROUND(ABS(SUM((a.ChipsCr-a.ChipsDr) * (pMaster+pAdmin) / 100) - IFNULL(i.comm, 0)), 2)  ELSE 0 END Comm ,ResultID , BetID,CONCAT(pMatchNM ,' ', pMarketNM  ,' Partnership Dealer To Master [ Winner : ', pSelectionNM , ' ]' ) , pSportsNM , 5, pMatchID ,pMarketID, 0, 0, 0, 0, b.parentId, 1, b.parentId, 'Parent A/c' FROM  tblchipdet a 
INNER JOIN createmaster b ON a.parantid = b.MstrId 
LEFT JOIN (SELECT SUM(chipsdr) comm, userid, parantid FROM tblchipdet WHERE MatchId =pMatchID AND MarketId =pMarketID AND levelV = 1 AND msttype = 6) i ON i.userid = b.mstrid AND i.parantid = b.parentId WHERE  a.MatchId =pMatchID AND a.MarketId =pMarketID AND levelV = 0 AND msttype = 5  GROUP BY MstDate ,b.mstrid ,LID, BetID, b.MstrUserId, b.parentId ;


SELECT MstDate, b.mstrid, 1, 1, CASE WHEN SUM(a.ChipsCr-a.ChipsDr) < 0 THEN ROUND(ABS(SUM(a.ChipsCr-a.ChipsDr)), 2) ELSE 0 END, CASE WHEN SUM(a.ChipsCr-a.ChipsDr) > 0 THEN ROUND(ABS(SUM(a.ChipsCr-a.ChipsDr)), 2) ELSE 0 END, LID, BetID ,CONCAT(pMatchNM ,' ', pMarketNM  ,   ' From  ', c.MstrUserId , ' ]') ,pSportsNM , 5 ,pMatchID ,pMarketID, UserID, 0, 0, 0, b.parentId, 2, userId, 'Dealer A/c' FROM tblchipdet a 
INNER JOIN createmaster b ON a.parantid = b.MstrId 
INNER JOIN createmaster c ON a.userid = c.MstrId 
WHERE MatchId =pMatchID AND MarketId =pMarketID  AND levelV = 1 AND msttype = 5 AND ChildID = 0 GROUP BY MstDate , b.mstrid ,LID,BetID, c.MstrUserId, UserID, b.parentId;
SELECT MstDate ,b.mstrid ,1 ,1,  ROUND(ABS(SUM(a.ChipsCr-a.ChipsDr)), 2) , 0, LID, BetID ,CONCAT(' Commission On ', pMatchNM ,' ', pMarketNM  ,   ' From ', c.MstrUserId , ' ]') ,pSportsNM , 6, pMatchID ,pMarketID, UserID, 0, 0, 0, b.parentId, 2, userId, 'Dealer Commission' FROM    tblchipdet a 
INNER JOIN createmaster b ON a.parantid = b.MstrId 
INNER JOIN createmaster c ON a.UserID = c.MstrId 
WHERE MatchId =pMatchID AND MarketId =pMarketID  AND levelV = 1 AND msttype = 6 AND ChildID = 0 GROUP BY MstDate ,b.mstrid ,LID,BetID, c.MstrUserId, UserID, b.parentId HAVING SUM(a.ChipsCr-a.ChipsDr) < 0;
SELECT mstdate, c.mstrid , 1, 1, 0, ROUND(ROUND(ABS(SUM((a.ChipsCr-a.ChipsDr)*c.Commission / 100 )), 4), 2) Comm , LID , BetID,CONCAT(pMatchNM ,' ', pMarketNM  ,' Commission Master To Admin [ Winner : ', pSelectionNM , ' ]' ) , pSportsNM ,6, pMatchID ,pMarketID, 0, 0, 0, 0, c.parentId, 2, c.parentId, 'Parent Commission' FROM  tblchipdet a 
INNER JOIN createmaster b ON a.parantid = b.MstrId  
INNER JOIN createmaster c ON b.parentid = c.MstrId 
WHERE  a.MatchId =pMatchID AND a.MarketId =pMarketID AND levelV = 0 AND msttype = 5  GROUP BY MstDate ,c.mstrid ,LID,BetID, c.MstrUserId, c.parentId HAVING SUM(a.ChipsCr-a.ChipsDr) > 0;
SELECT mstdate, c.mstrid , 1, 1, CASE WHEN SUM(a.ChipsCr-a.ChipsDr) > 0 THEN ROUND(ABS(SUM((a.ChipsCr-a.ChipsDr) * (pAdmin) / 100)), 2)  ELSE 0 END, CASE WHEN SUM(a.ChipsCr-a.ChipsDr) < 0 THEN ROUND(ABS(SUM((a.ChipsCr-a.ChipsDr) * (pAdmin) / 100)- IFNULL(i.comm, 0)), 2)  ELSE 0 END Comm ,LID , BetID,CONCAT(pMatchNM ,' ', pMarketNM  ,' Partnership Master To Admin [ Winner : ', pSelectionNM , ' ]' ) , pSportsNM , 5, pMatchID ,pMarketID, 0, 0, 0, 0, c.parentId, 2, c.parentId, 'Parent A/c' FROM  tblchipdet a 
INNER JOIN createmaster b ON a.parantid = b.MstrId  
INNER JOIN createmaster c ON b.parentid = c.MstrId 
LEFT JOIN (SELECT SUM(chipsdr) comm, userid, parantid FROM tblchipdet WHERE MatchId =pMatchID AND MarketId =pMarketID AND levelV = 2 AND msttype = 6) i ON i.userid = c.mstrid AND i.parantid = c.parentId WHERE  a.MatchId =pMatchID AND a.MarketId =pMarketID AND levelV = 0 AND msttype = 5  GROUP BY MstDate ,c.mstrid ,LID, BetID, c.MstrUserId, c.parentId ;


SELECT MstDate, b.mstrid, 1, 1, CASE WHEN SUM(a.ChipsCr-a.ChipsDr) < 0 THEN ROUND(ABS(SUM(a.ChipsCr-a.ChipsDr)), 2) ELSE 0 END, CASE WHEN SUM(a.ChipsCr-a.ChipsDr) > 0 THEN ROUND(ABS(SUM(a.ChipsCr-a.ChipsDr)), 2) ELSE 0 END, LID, BetID ,CONCAT(pMatchNM ,' ', pMarketNM  ,   ' From  ', c.MstrUserId , ' ]') ,pSportsNM , 5 ,pMatchID ,pMarketID, UserID, 0, 0, 0, b.parentId, 3, userId, 'Master A/c' FROM tblchipdet a 
INNER JOIN createmaster b ON a.parantid = b.MstrId 
INNER JOIN createmaster c ON a.userid = c.MstrId 
WHERE MatchId =pMatchID AND MarketId =pMarketID  AND levelV = 2 AND msttype = 5 AND ChildID = 0 GROUP BY MstDate , b.mstrid ,LID,BetID, c.MstrUserId, UserID, b.parentId;
SELECT MstDate ,b.mstrid ,1 ,1,  ROUND(ABS(SUM(a.ChipsCr-a.ChipsDr)), 2) , 0, LID, BetID ,CONCAT(' Commission On ',pMatchNM ,' ', pMarketNM  ,   ' From ', c.MstrUserId , ' ]') ,pSportsNM , 6, pMatchID ,pMarketID, UserID, 0, 0, 0, b.parentId, 3, userId, 'Master Commission' FROM    tblchipdet a 
INNER JOIN createmaster b ON a.parantid = b.MstrId 
INNER JOIN createmaster c ON a.UserID = c.MstrId 
WHERE MatchId =pMatchID AND MarketId =pMarketID  AND levelV = 2 AND msttype = 6  AND ChildID = 0 GROUP BY MstDate ,b.mstrid ,LID,BetID, c.MstrUserId, UserID, b.parentId HAVING SUM(a.ChipsCr-a.ChipsDr) < 0;

IF (chkMarket = 1) THEN
