CREATE DEFINER=`placebet_Place36`@`%` PROCEDURE `SP_SetResult_Other` (IN `pSportsID` INT, IN `pMatchID` INT, IN `pFancyID` INT, IN `pResult` VARCHAR(100), IN `pTypeID` INT, IN `pHelperID` INT)  BEGIN
DECLARE  LID INTEGER ;
DECLARE sFancy VARCHAR(100);
DECLARE iReturn INT;
DECLARE sMsg VARCHAR(500);
DECLARE EXIT HANDLER FOR SQLEXCEPTION
BEGIN
     SET iReturn = 0;
 GET DIAGNOSTICS CONDITION 1 @sqlstate = RETURNED_SQLSTATE, @errno = MYSQL_ERRNO, @text = MESSAGE_TEXT; 
    SET sMsg = CONCAT("ERROR ", @errno, " (", @sqlstate, "): ", @text);  
  ROLLBACK;
SELECT iReturn ,sMsg;
END;
DECLARE EXIT HANDLER FOR SQLWARNING
 BEGIN
    SET iReturn = 0;
GET DIAGNOSTICS CONDITION 1 @sqlstate = RETURNED_SQLSTATE, @errno = MYSQL_ERRNO, @text = MESSAGE_TEXT; 
    SET sMsg = CONCAT("ERROR ", @errno, " (", @sqlstate, "): ", @text);
 ROLLBACK;
SELECT iReturn ,sMsg;
END;
MainLabel:BEGIN
IF (SELECT result FROM tblresult WHERE sportId = pSportsID AND matchId = pMatchID AND selectionId = pFancyID ) IS NOT NULL THEN
	SET iReturn = 0;
	SET sMsg = "Already Saved ...";
	SELECT iReturn , sMsg; 
    LEAVE MainLabel;
END IF; 
SET iReturn = 1;
SET sMsg = "Saved Successfully ...";
START TRANSACTION;
SET LID = LAST_INSERT_ID();
UPDATE matchfancy SET result = pResult, active = 2, DisplayMsg = 'Close Fancy ' WHERE MatchID =pMatchID AND ID =pFancyID; 
if pTypeID = 1 then
	
	SET sFancy = ' Odd-Even ';
	UPDATE bet_entry SET ResultID =LID,Chips =  case when MOD(pResult , 2) = OddValue Then IFNULL(bet_value,0) else  -IFNULL(bet_value,0) end WHERE MatchID =pMatchID AND FancyID =pFancyID AND TypeID = 1 ;  
elseif pTypeID = 4 then
	
	SET sFancy = ' Last-Digit '; 
	update bet_entry a inner join matchfancy b on a.fancyID = b.ID and b.TypeID =4
		set ResultID =LID , Chips =  case when RIGHT(pResult,1) = OddValue Then IFNULL(bet_value,0)* b.upDwnLimit else  -IFNULL(bet_value,0) end WHERE a.MatchID =pMatchID AND a.FancyID =pFancyID AND a.TypeID = 4 ;  
	
elseif pTypeID = 3 then 
	
	SET sFancy = ' Khaddal ';
	UPDATE bet_entry SET ResultID =LID , Chips =  case when pResult >= OddValue and pResult <= (OddValue + OddsNumber -1 )  Then IFNULL(bet_value,0) else  -IFNULL(bet_value,0) end  WHERE MatchID =pMatchID AND FancyID =pFancyID AND TypeID = 3  ;  
 elseif pTypeID = 5 then 
	
	SET sFancy = ' Up-Down ';
	UPDATE bet_entry SET ResultID =LID , Chips = case when (OddValue = 1 and pResult >= OddsNumber) or (OddValue = 0 and pResult <= OddsNumber) Then ABS((OddsNumber- pResult)*bet_value) else  -ABS((OddsNumber- pResult)*bet_value) end WHERE MatchID =pMatchID AND FancyID =pFancyID AND TypeID = 5;   
End if;
 
SELECT NOW(), userId, 1, 1, CASE WHEN pnl > 0 THEN ROUND(pnl, 2) ELSE 0 END, CASE WHEN pnl < 0 THEN ROUND(ABS(pnl), 2) ELSE 0 END, LID, 0, CONCAT('PnL from ', sFancy ,' Fancy ',pResult ) , FheadName ,8, pMatchID, pFancyID, 0, MASTER, dealer, admin, parantid, 0, parantId, 'Parent' FROM (SELECT UserID, MASTER, dealer, admin, parantid, FheadName ,SUM(Chips) pnl FROM bet_entry 
WHERE MatchID =pMatchID AND FancyID = pFancyID  GROUP BY  UserID ,FheadName ,MASTER, dealer, admin, parantid) j; 
if pTypeID = 1 then 
