if pTypeID = 1 then 
	SELECT MstDate ,b.mstrid ,1 ,1, ROUND(ABS(SUM(a.ChipsCr-a.ChipsDr)), 2) , 0, LID, BetID ,CONCAT(RefID  , ' Comm. From ',c.MstrUserId , ' ]') ,RefID , 9, pMatchID ,pFancyID, UserID, 0, 0, 0, b.parentId, 1, userId, 'Client Other Comm.' FROM    tblchipdet a 
