SELECT MstDate ,b.mstrid ,1 ,1, 0,  IFNULL(ROUND(ABS(SUM(a.ChipsCr-a.ChipsDr)), 2),0) , LID, BetID ,CONCAT(RefID  ,   '[ Comm. To  ', c.MstrUserId , ' ]') ,'' , 9, pMatchID ,pFancyID, UserID, 0, 0, 0, b.parentId, 2, userId, 'Dealer Commission' FROM    tblchipdet a 
INNER JOIN createmaster b ON a.parantid = b.MstrId 
INNER JOIN createmaster c ON a.UserID = c.MstrId 
WHERE MatchId =pMatchID AND FancyId =pFancyID  AND levelV = 1 AND msttype = 9 AND ChildID = 0 GROUP BY MstDate ,b.mstrid ,LID,BetID, c.MstrUserId, UserID, b.parentId HAVING SUM(a.ChipsCr-a.ChipsDr) > 0;

SELECT mstdate, c.mstrid , 1, 1, IFNULL(ROUND(ROUND(((SELECT SUM(bet_value) as betsum FROM bet_entry  WHERE parantid = b.MstrId AND MatchID =pMatchID AND FancyID = pFancyID)*c.SessionComm*pAdmin/10000), 4), 2),0) Comm , 0, LID , BetID,CONCAT(RefID  ,' Comm. Master From Admin [ Session : ', pResult , ' ]','betval=',(SELECT SUM(bet_value) as betsum FROM bet_entry WHERE parantid = b.MstrId AND MatchID =pMatchID AND FancyID = pFancyID),'sesscomm=',c.SessionComm,'pdea=',pAdmin,'uid=',c.mstrid  ) , RefID ,9, pMatchID ,pFancyID, 0, 0, 0, 0, c.parentId, 2, c.parentId, 'Parent Commission' FROM  tblchipdet a 
INNER JOIN createmaster b ON a.parantid = b.MstrId  
INNER JOIN createmaster c ON b.parentid = c.MstrId 
WHERE  a.MatchId =pMatchID AND a.FancyId =pFancyID AND levelV = 0 AND msttype = 9  GROUP BY MstDate ,c.mstrid ,LID,BetID, c.MstrUserId, c.parentId HAVING SUM(a.ChipsCr-a.ChipsDr) >= 0;

SELECT mstdate, c.mstrid , 1, 1, CASE WHEN SUM(a.ChipsCr-a.ChipsDr) > 0 THEN IFNULL(ROUND(ABS(SUM((a.ChipsCr-a.ChipsDr) * (pAdmin) / 100)), 2),0)  ELSE 0 END, CASE WHEN SUM(a.ChipsCr-a.ChipsDr) < 0 THEN IFNULL(ROUND(ABS(SUM((a.ChipsCr-a.ChipsDr) * (pAdmin) / 100)) , 2),0)  ELSE 0 END Comm ,LID , BetID,CONCAT(RefID  ,' Partnership Master To Admin [ Session : ', pResult , ' ]' ) , RefID , 8, pMatchID ,pFancyID, 0, 0, 0, 0, c.parentId, 2, c.parentId, 'Parent A/c' FROM  tblchipdet a 
INNER JOIN createmaster b ON a.parantid = b.MstrId  
INNER JOIN createmaster c ON b.parentid = c.MstrId 
WHERE  a.MatchId =pMatchID AND a.FancyId =pFancyID AND levelV = 0 AND msttype = 8  GROUP BY MstDate ,c.mstrid ,LID, BetID, c.MstrUserId, c.parentId ;


SELECT MstDate, b.mstrid, 1, 1, CASE WHEN SUM(a.ChipsCr-a.ChipsDr) < 0 THEN ifnull(ROUND(ABS(SUM(a.ChipsCr-a.ChipsDr)), 2),0) ELSE 0 END, CASE WHEN SUM(a.ChipsCr-a.ChipsDr) > 0 THEN IFNULL(ROUND(ABS(SUM(a.ChipsCr-a.ChipsDr)), 2),0) ELSE 0 END, LID, BetID ,CONCAT(RefID  , ' From  ', c.MstrUserId , ' ]') ,RefID , 8 ,pMatchID ,pFancyID, UserID, 0, 0, 0, b.parentId, 3, userId, 'Master A/c' FROM tblchipdet a 
INNER JOIN createmaster b ON a.parantid = b.MstrId 
INNER JOIN createmaster c ON a.userid = c.MstrId 
WHERE MatchId =pMatchID AND FancyId =pFancyID  AND levelV = 2 AND msttype = 8 AND ChildID = 0 GROUP BY MstDate , b.mstrid ,LID,BetID, c.MstrUserId, UserID, b.parentId;

SELECT MstDate ,b.mstrid ,1 ,1,  0, IFNULL(ROUND(ABS(SUM(a.ChipsCr-a.ChipsDr)), 2),0) , LID, BetID ,CONCAT(RefID  ,   '[ Comm. To  ', c.MstrUserId , ' ]') ,RefID , 9, pMatchID ,pFancyID, UserID, 0, 0, 0, b.parentId, 3, userId, 'Master Commission' FROM    tblchipdet a 
INNER JOIN createmaster b ON a.parantid = b.MstrId 
INNER JOIN createmaster c ON a.UserID = c.MstrId 
WHERE MatchId =pMatchID AND FancyId =pFancyID  AND levelV = 2 AND msttype = 9  AND ChildID = 0 GROUP BY MstDate ,b.mstrid ,LID,BetID, c.MstrUserId, UserID, b.parentId HAVING SUM(a.ChipsCr-a.ChipsDr) > 0;
COMMIT;
SELECT iReturn ,sMsg;
END;
END$$

CREATE DEFINER=`placebet_Place36`@`%` PROCEDURE `sp_SetRights` (IN `pUserID` INT, IN `pParentID` INT, IN `pLoginID` INT, IN `pMatchID` INT, IN `pMarketID` VARCHAR(100), IN `pFancyID` INT, IN `pIsPlay` INT, IN `pTypeID` INT)  BEGIN
DECLARE resultV INT; DECLARE retMess VARCHAR(500);
DECLARE EXIT HANDLER FOR SQLEXCEPTION
  BEGIN
   SET resultV = -1;
    GET DIAGNOSTICS CONDITION 1 @sqlstate = RETURNED_SQLSTATE, @errno = MYSQL_ERRNO, @text = MESSAGE_TEXT; 
    SET retMess = CONCAT("ERROR ", @errno, " (", @sqlstate, "): ", @text); 
    ROLLBACK;    
    SELECT resultV, retMess;
END;
DECLARE EXIT HANDLER FOR SQLWARNING
 BEGIN
   SET resultV = -2;
    GET DIAGNOSTICS CONDITION 1 @sqlstate = RETURNED_SQLSTATE, @errno = MYSQL_ERRNO, @text = MESSAGE_TEXT; 
    SET retMess = CONCAT("ERROR ", @errno, " (", @sqlstate, "): ", @text);     
    ROLLBACK;
    SELECT resultV, retMess;
END;
 
START TRANSACTION;

if pIsPlay = 0 then 

		VALUES (pUserID ,pMatchID ,pMarketID ,pFancyID ,1);
	
	
	if pTypeID = 0 then 
	select mstrid ,parentID,pLoginID,pMatchID,pMarketID,pFancyID,NOW() from  `createmaster` where mstrID <> 1;
 
	 ELSEIF pTypeID = 1 THEN
	select mstrid ,parentID,pLoginID,pMatchID,pMarketID,pFancyID,NOW() from  `createmaster` where parentId = pUserID;

	select mstrid ,parentID,pLoginID,pMatchID,pMarketID,pFancyID,NOW() from  `createmaster` where parentId in (select mstrID from  `createmaster` where usetype = 2 AND parentId = pUserID);
	
	elseif pTypeID = 2 then 
	
	select mstrid ,parentID,pLoginID,pMatchID,pMarketID,pFancyID,NOW() from  `createmaster` where parentId = pUserID;
	
	End if;
else
DELETE FROM tblPlay WHERE UserID = pUserID AND MatchID = pMatchID and MarketID = pMarketID and FancyID = pFancyID;
	 
	if pTypeID = 0 then  
		delete from tblRights where UserID in (select mstrid from  `createmaster` where mstrID <> 1) and MatchID=pMatchID and  MarketID=pMarketID and FancyID=pFancyID; 
		
	elseif pTypeID = 1 then 	
	delete from tblRights where UserID in (select mstrid from  `createmaster` where parentId = pUserID and usetype = 2) and MarketID=pMarketID and FancyID=pFancyID; 

	delete from tblRights where parentId in (select mstrID from  `createmaster` where usetype = 2 AND parentId = pUserID) and MatchID=pMatchID and 
		MarketID=pMarketID and FancyID=pFancyID; 
	
	elseif pTypeID = 2 then  
	delete from tblRights where parentId = pUserID and MatchID=pMatchID and 
		MarketID=pMarketID and FancyID=pFancyID; 
	
End if;
End if;
COMMIT;
SET resultV = 0;
	SET retMess = 'Saved Successfully ...';
	SELECT resultV, retMess;
	
	END$$

CREATE DEFINER=`placebet_Place36`@`%` PROCEDURE `sp_updLockStatus` (IN `p_userId` INT, IN `p_userType` INT, IN `p_lockType` INT, IN `p_activeVl` INT, IN `p_loginId` INT, IN `pHelperID` INT)  BEGIN
 
DECLARE exit handler for sqlexception
  BEGIN
        
  ROLLBACK;
END;

DECLARE exit handler for sqlwarning
 BEGIN
     ROLLBACK;
END;

 
START TRANSACTION;
	if (p_loginId <> p_userId) then 
		update createmaster set mstrlock = p_lockType where mstrid = p_userId;
		update loginusers set active = p_activeVl where usecode = p_userId;	
	end if;

    if (p_userType = 2) then
		update createmaster a set mstrlock = p_lockType where a.parentId = p_userId ;
        update loginusers a inner join createmaster b on b.loginid = a.usecode set a.active = p_activeVl where b.parentId = p_userId ;
    else if (p_userType = 1) then		
		update createmaster a inner join vewuserparentmaster b on b.mstrid = a.mstrid  set mstrlock = p_lockType where b.masterid = p_userId;
        update loginusers a inner join vewuserparentmaster b on b.loginid = a.usecode set active = p_activeVl where b.masterid = p_userId;
	end if;
    end if;
COMMIT;

END$$

CREATE DEFINER=`placebet_Place36`@`%` PROCEDURE `sp_UpdMatchfancy` (IN `pMatchID` INT, IN `pHeadName` TEXT, IN `pTypeID` INT, IN `pRemarks` TEXT, IN `pdate` DATE, IN `ptime` TIME, IN `pSessInptYes` INT, IN `pSessInptNo` INT, IN `pfancyRange` INT, IN `pPlayerId` INT, IN `pactive` INT, IN `presult` VARCHAR(50), IN `pupDwnBack` INT, IN `pupDwnLay` INT, IN `pMFancyID` INT, IN `pSprtId` INT, IN `prateDiff` DECIMAL(10,2), IN `ppointDiff` DECIMAL(10,2), IN `pMaxStake` DECIMAL(10,2), IN `pNoValume` INT, IN `pYesValume` INT, IN `pID` INT, IN `pUpDwnLimit` INT)  BEGIN

