SET retMess = "Update Successfully...";
	SELECT resultV, retMess;
	
	END$$

CREATE DEFINER=`placebet365`@`localhost` PROCEDURE `sp_UserPnLDetails` (IN `p_marketId` VARCHAR(20))  NO SQL
BEGIN 
	select a.matchId, a.selectionId, a.marketId, a.selectionName, b.UserId, b.ParantId, case when b.isBack = 0 then b.p_l else -b.p_l end winValue, 0 as lossValue, b.MstCode, b.MstDate, b.odds, b.Stack, b.p_l, b.isback from tblSelection a LEFT JOIN tblbets b on b.SelectionId = a.selectionId and a.MarketId = b.marketId where a.MarketId = p_marketId 
    union
	select a.matchId, a.selectionId, a.marketId, a.selectionName, b.UserId, b.ParantId, 0 as winValue, case when b.isBack = 0 then -b.stack else b.stack end lossValue, b.MstCode, b.MstDate, b.odds, b.Stack, b.p_l, b.isback from tblSelection a LEFT JOIN tblbets b on b.SelectionId <> a.selectionId and a.MarketId = b.marketId where a.MarketId = p_marketId ;    
 END$$

CREATE DEFINER=`placebet365`@`localhost` PROCEDURE `Test1` (IN `pType` INT, IN `UserID` INT)  NO SQL
BEGIN
SET @Type = pType;

if @Type="0" then
    SET @Where = " and IsFree =0";
elseif @Type = "1" then
    SET @Where = " and IsFree =1 ";
elseif @Type = "2" then
    SET @Where = " and a.ResultID = 1 ";
elseif @Type = "3" then
    SET @Where = " and a.ResultID = 0 ";
else
    SET @Where ="";
end if; 

SET @runtot:=0; 
SET @query = CONCAT('SELECT  a.RefId RefNo, a.MstDate EDate, 
                    crtmst.mstruserid UserC, CASE CrDr WHEN CrDr =1 THEN 
                    Chips ELSE 0 END Credit, CASE CrDr WHEN CrDr =1 THEN 
                    0 ELSE Chips END Debit, (@runtot := @runtot + Chips) 
                    Total,narration ,
                    case when a.betid is null then 0 else b.Odds end Odds ,
                    case when a.betid is null then 0 else b.Stack end Stack ,
                    case when a.betid is null or a.ResultID is null then 0 else 
case when ifnull(b.Result,0) = 1 then ''Win'' else ''Lost'' end 
end Status_  FROM tblchips a 
INNER JOIN createmaster crtmst ON a.UserId=crtmst.mstrid 
left join tblbets b on a.betID = b.MstCode
where 1=1 ' , @Where  , ' and a.UserId = ', UserID , ' order by a.MstDate desc ');

 
PREPARE stmt FROM @query;
EXECUTE stmt;
DEALLOCATE PREPARE stmt;

end$$

