CREATE DEFINER=`placebet_Place36`@`%` FUNCTION `FN_getLibility` (`User_ID` INT(11)) RETURNS DECIMAL(10,2) NO SQL
BEGIN
  DECLARE profit DECIMAL(9,2);
  
  SET profit = (case when ROUND(IFNULL((Select sum(X .mSum)Liability from(select min(a.pnlvalue)'mSum' from (SELECT SUM(winValue + lossValue) pnlvalue, matchId, MarketId, SelectionId 
		FROM vewUserPnlDetails WHERE userId = User_ID GROUP BY matchId, MarketId, SelectionId )a Where a.pnlvalue<0  group by MarketId)X ), 0)
		+ IFNULL((SELECT SUM(bet_value)*-1  Liability from  `bet_entry` WHERE TypeID in (3) AND ResultID is null and userid = User_ID ), 0)+
		 IFNULL((select SUM(bet_value )*-1 Liability  from  `bet_entry` a inner join matchfancy b on a.fancyId = b.ID where a.TypeID = 4 and ResultID is null and userid = User_ID), 0)
		 + IFNULL((SELECT SUM(minvalue) Liability  FROM (SELECT MIN(pnlvalue) minvalue, matchId, MarketId FROM (SELECT SUM(aa) pnlvalue, matchId, fancyid  MarketId, yes SelectionId FROM vewsessionliability WHERE userId = User_ID GROUP BY yes,  matchId, fancyid) X GROUP BY matchId, MarketId)  Y), 0) +
		  IFNULL((SELECT SUM(minvalue)  Liability  FROM (SELECT MIN(pnlvalue) minvalue, matchId, MarketId FROM (SELECT SUM(aa) pnlvalue, matchId, fancyid  MarketId, runvalue SelectionId FROM vewUpDownliability WHERE userId = User_ID GROUP BY runvalue,  matchId, fancyid) X1 GROUP BY matchId, MarketId)  Y1), 0)
		   + IFNULL((SELECT SUM(winValue) Liability  FROM  vewUserPnlUnMOnly WHERE userId = User_ID ), 0)
			 + IFNULL((SELECT ifnull(Liability, 0) * case when ifnull(Liability, 0) > 0 then -1 else 1 end Liability from (select SUM(case when OddValue = 1 then 1 else -1 end * bet_value) Liability from `bet_entry` where TypeID in (1) and ResultID is null and userid = User_ID) qryOEinner), 0), 2) < 0 then
			  ROUND(IFNULL((Select sum(X .mSum)Liability from(select min(a.pnlvalue)'mSum' from (SELECT SUM(winValue + lossValue) pnlvalue, matchId, MarketId, SelectionId 
FROM vewUserPnlDetails WHERE userId = User_ID GROUP BY matchId, MarketId, SelectionId )a Where a.pnlvalue<0  group by MarketId)X ), 0)
 + IFNULL((select SUM(bet_value)*-1  Liability from  `bet_entry` where TypeID in (3) and ResultID is null and userid = User_ID ), 0) 
 + IFNULL((select SUM(bet_value )*-1 Liability  from  `bet_entry` a inner join matchfancy b on a.fancyId = b.ID where a.TypeID = 4 and ResultID is null and userid = User_ID), 0)
 + IFNULL((SELECT SUM(minvalue) Liability  FROM (SELECT MIN(pnlvalue) minvalue, matchId, MarketId FROM (SELECT SUM(aa) pnlvalue, matchId, fancyid  MarketId, yes SelectionId FROM vewsessionliability WHERE userId = User_ID GROUP BY yes,  matchId, fancyid) X GROUP BY matchId, MarketId)  Y), 0)
  + IFNULL((SELECT SUM(minvalue)  Liability  FROM (SELECT MIN(pnlvalue) minvalue, matchId, MarketId FROM (SELECT SUM(aa) pnlvalue, matchId, fancyid  MarketId, runvalue SelectionId FROM vewUpDownliability WHERE userId = User_ID GROUP BY runvalue,  matchId, fancyid) X1 GROUP BY matchId, MarketId)  Y1), 0) 
  + IFNULL((SELECT SUM(winValue) Liability  FROM  vewUserPnlUnMOnly WHERE userId = User_ID ), 0) 
  + IFNULL((SELECT ifnull(Liability, 0) * case when ifnull(Liability, 0) > 0 then -1 else 1 end Liability from (select SUM(case when OddValue = 1 then 1 else -1 end * bet_value) Liability from `bet_entry` where TypeID in (1) and ResultID is null and userid = User_ID) qryOEinner), 0), 2) else 0 end  

  );  
  RETURN profit;
  
END$$

