IFNULL((select ifnull(Liability, 0) * case when ifnull(Liability, 0) > 0 then -1 else 1 end Liability from (select SUM(case when OddValue = 1 then 1 else -1 end * bet_value) Liability from `bet_entry` where TypeID in (1) and ResultID is null and userid = User_ID) qryOEinner), 0), 2) else 0 end ,2)

