CREATE DEFINER=`placebet_Place36`@`%` FUNCTION `Fn_getUserFreeChip` (`User_ID` INT) RETURNS DECIMAL(20,2) NO SQL
BEGIN
  DECLARE profit DECIMAL(9,2);
  
