CREATE DEFINER=`placebet_Place36`@`%` FUNCTION `FN_getUserP_L` (`User_ID` INT) RETURNS DECIMAL(20,2) BEGIN
  DECLARE profit DECIMAL(9,2);
  
  SET profit = (
  		IFNULL(((SELECT IFNULL(SUM(P_L),0 )P_L FROM `tblbets` WHERE result =1 AND isBack = 0 AND UserID =User_ID) 
  + (SELECT IFNULL(SUM(-P_L),0 )P_L FROM `tblbets` WHERE result =1 AND isBack = 1 AND UserID =User_ID) 
  + (SELECT IFNULL(SUM(-Stack),0 )P_L FROM `tblbets` WHERE result =0 AND isBack = 0 AND UserID =User_ID) 
  + (SELECT IFNULL(SUM(Stack),0 )P_L FROM `tblbets` WHERE result =0 AND isBack = 1 AND UserID =User_ID)),0)
  );  
  RETURN profit;
  
END$$

